import React from "react";
import { Container } from "react-bootstrap";
import styled from "styled-components";


const Title = styled.h2`
  font-weight: 300;
`;

const CardContainer = styled.div`
  display: flex;
  flex-wrap: nowrap;
  overflow-x: auto;
  &::-webkit-scrollbar {
    display: none;
  }
`;

const Card = styled.div`
 background-color: gray;
  margin-right: 16px;
  width: 15rem;
  flex-shrink: 0;
`;


const DogCarousel = () => {
  return (
<Container fluid className="py-2" style={{ overflowX: "hidden" }}>
      <h2 className="font-weight-light m-4">Bootstrap 4 Horizontal Scrolling Cards with Flexbox</h2>
      <CardContainer className="d-flex flex-row">
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">
        <img class="card-img-top" src="..." alt="Card image cap"/>
  <div class="card-body">
    <h5 class="card-title">Card title</h5>
    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" class="btn btn-primary">Go somewhere</a>
  </div>
        </Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 2</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 3</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 4</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 5</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 6</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 7</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 8</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 9</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 10</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 11</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 12</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3">Card 13</Card>
        <Card className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0">Card 14</Card>
      </CardContainer>
    </Container>
  );
};

export default DogCarousel;
